import React, {useState} from "react";
import {CustomerStore, ICustomer} from "./CustomerStore";

interface IProps {}
interface IState {
    customers : ICustomer[]
}

let Customers:React.FC<IProps> =() =>{
    let [customerState,setCustomerState] = useState<IState>({
        customers:CustomerStore.customerData
    });
    let {customers} =customerState;

    return(
        <React.Fragment>
            <section className="mt-3">
                <div className="container">
                    <div className="row">
                        <div className="col">
                            <p className="h3 text-primary">Customer Details</p>
                            <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Alias aliquam, beatae cumque delectus dolores eveniet itaque maxime molestiae nemo nulla pariatur perferendis ratione rem repellat similique, sint sit temporibus veritatis.</p>
                        </div>
                    </div>
                    <div className="row">
                        <div className="col">
                            <table className="table table-hover text-center table-primary">
                                <thead className="bg-dark">
                                <tr>
                                    <th>SNO</th>
                                    <th>Image</th>
                                    <th>Name</th>
                                    <th>Age</th>
                                    <th>Email</th>
                                    <th>Location</th>
                                </tr>
                                </thead>
                                <tbody>
                                {
                                    customers.map(customer => {
                                        return (
                                            <tr key ={customer.login.uuid}>
                                                <td>{customer.login.uuid.substr(customer.login.uuid.length - 5)}</td>
                                                <td>
                                                    <img src={customer.picture.large} alt="" width="50" height="50"/>
                                                </td>
                                                <td>{customer.name.first} {customer.name.last}</td>
                                                <td>{customer.dob.age} yrs</td>
                                                <td>{customer.email}</td>
                                                <td>{customer.location.city}</td>
                                            </tr>
                                        );

                                    })
                                }
                                </tbody>
                            </table>
                        </div>
                    </div>
                </div>
            </section>
        </React.Fragment>
    )
};
export default Customers;
